select urun,age(now(), satis_tarihi) as 'yas' from satislarimiz;


select  min(salary) as salary from odev3 ;    // en küçük maas

select  max(salary) as salary from odev3 ;    // en yüksek maas

select  sum(salary) as salary from odev3;    // toplam ödenen maas

select  avg(salary) as salary from odev3;    // toplam ödenen maaslarýn artalamasý


select * from odev3 where salary in (select max(salary) from odev3);                // odev3 de en yüksek maas alaný gösterir

select * from odev3 where salary in (select min(salary) from odev3);               // odev3 de en az maas alaný gösterir


select  Country_Of_Birty,  min(salary) as salary from odev3 group by  Country_Of_Birty ;    // ülkelere göre en küçük maaslar

select  Country_Of_Birty,  max(salary) as salary from odev3 group by  Country_Of_Birty ;    // ülkelere göre en yüksek maaslar

select  Country_Of_Birty,  sum(salary) as salary from odev3 group by  Country_Of_Birty ;    // ülkelere göre ödenen toplam maaslar

select  Country_Of_Birty,  avg(salary) as salary from odev3 group by  Country_Of_Birty ;    // ülkelere göre ortalama maaslar


select distinct Country_Of_Birty from odev3;                                             // hangi ülkeler var 

select Country_Of_Birty, count(*) from odev3 group by Country_Of_Birty;               // hangi ulkeden kaç kiþi var 

